 *
 * Author      : oO_CrunK_Oo / hug35
 * Updated     : 11th June, 2010
 * Description : Modifies the colors, logos, and a few other images on YouTube (http://youtube.com/)
 * Usage       : Use with Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 *
 */

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("youtube.com") {

body{
  color: #ddd !important;
  background: #0D0D0D url('http://img63.imageshack.us/img63/6505/guccibackground.png') !important;
  background-repeat: repeat-y;
  background-attachment: fixed !important;
  background-size: 100% !important;
  background-position: center !important;
}

/* Div / Table / List Transparency Fixes
---------------------------------------*/
#watch-headline-container, #watch-video-container, #watch-headline h1, .video-stat, .video-messages, .groupnamecont, #content, #verify-age h2{
  background: none !important;
  color: #ddd !important;
}

.main-tabs-promo{
  display: none !important;
}

/* MasterHeader / Footer / Body
----------------------------*/
#masthead-container{
  background: #111 !important;
  border-bottom: 1px solid #444 !important;
}

#footer-container{ 
  background: #111 !important;
  border-Top: 1px solid #444 !important;
}

#footer, #region-picker, #language-picker, #safetymode-picker{
  border: none !important;
}

#baseDiv{
  padding-bottom:0px !important;
}

#picker-container{
  background: #333 !important;
  border: none !important;
}

/* Search Bar Suggestions
----------------------------*/
.yt-suggest-selected .yt-suggest-selected .yt-suggest-left, .yt-suggest-selected .yt-suggest-right, .yt-suggest-selected .yt-suggest-left {
  background: #555 !important;
}

.yt-suggest-unselected, .yt-suggest-close {
  background: #333 !important;
  border: none !important;  
}

/* Links 
--------------*/
a, .video-list-item .title, .opt-close-text, .iyt-edit-link, .watch-disco-suggested-artist, .feedmodule-smtitle-wrapper, .popular-artist-row,
.yt-uix-button-menu-item, .yt-button, .yt-uix-expander-head, .yt-suggest-close span, .feedmodule-ts, .yt-menulink .yt-menulink-btn,
.watch-disco-video-queue-end, .watch-disco-video-queue-next{
 color: #aaa !important;
}

a.comment-author, a.watch-description-username{
  text-decoration:underline !important;
} 

/* Text
------------*/
.video-description b, .show-description b, .episode-description b, #chrome-promo-hp .tagline, h1.yt-static,#search-section-header .name,
.channel-description b, .movie-description b, .show-long-description b, .yt-static-sidebar-subhead, #mymedia #form-pane .radio-label, .hovercard-description, 
.show-short-description b, .show-mini-description b, .yt-suggest-right, #no-videos, #yt-static-main-content, .label, .comment-result-comment, .video-view-count,
.new-snippets .video-view-count, .new-snippets .playlist-video-count, .new-snippets .channel-video-count{
  color: #888 !important;
}

.video-list-item .stat strong, .video-list-item .views {
  color: #888 !important; font-weight: normal !important;
} 

/*-------------------------------- Main Page -------------------------------------*/

/* Recommended / Being Watched / Most Popular
-----------------------------------------------*/
.feedmodule-anchor, #homepage-whats-new-block, .homepage-side-block{
  background: #333 !important;
}

#fyf_container, .blue-box{
  background: #333 !important;
  border: 1px solid #222 !important;
}

.highlightBox{  
  background: #444!important;
  border: 1px solid #333 !important;
}

.fm-title-underlined-gray, .homepage-block-heading, #statmodules_inbox-title, #homepage-whats-new h2 {
  background: #222 !important;
  border-bottom: 1px solid #444 !important;
  padding: 5px 5px 2px!important;
  color: #888 !important;
}

#iyt-login-suggest-side-box div div{
  background: #222 !important;
  border: 1px solid #222 !important;
}

#iyt-login-suggest-side-box div, .fyf-container-services , .statModule-item-line{
  background: #333 !important;
  border: none !important;
}

.feedmodule-data, .homepage-whatsnew-entry{
  padding-left: 5px !important;
}

.opt-banner, .opt-main{
  background: #444 !important;
  border: none !important;
  width: 99% !important;
}

.opt-box-top{
  visibility: hidden !important;
}

/*-------------------------------- Browse Page -------------------------------------*/

.browse-categories-side, .browse-tab-modifiers, .subcategory, .main-tabs-spotlight-inner, .hot-trends-cloud-area{
  background: #333 !important;
}

.main-tabs-spotlight .video-entry, .hot-trends-cloud-inner-area {
  background: #444 !important;
}

.browse-tab-modifiers .first{
  background: #555 !important;
}

#browseMain .searchFooterBox div.yt-uix-pager, .browseAdditional .searchFooterBox div.yt-uix-pager {
  background: none !important;
  border-top: 1px solid #444 !important;
}

table.browse-modifiers-extended .browse-basic-modifiers .subcategory{
  background: none !important;
  color: #aaa !important;
}

.video-list-item .video-thumb{
  background: #444 !important;
  border-color: #444 !important;
} 


/* Menu Links And Video Borders
-----------------------------------*/
.yt-menulink-primary .yt-menulink-menu li a, .yt-menulink-primary .yt-menulink-menu span a,
table.browse-modifiers-extended .yt-menulink-menu a, table.browse-modifiers-extended .yt-menulink-menu, .yt-uix-button-menu .yt-uix-button-menu-item{
  background-color: #333 !important;
}

table.browse-modifiers-extended .yt-menulink-menu a:hover, .yt-uix-button-menu .yt-uix-button-menu-item:hover, .yt-uix-button-menu{
  background-color: #555 !important;
}

.video-thumb-220, .video-thumb-128, .video-thumb-120, .video-thumb-90, .video-thumb-50  {
  border: 2px solid #555 !important;
}

.yt-menubutton-primary .yt-menubutton-menu, .yt-menulink-primary .yt-menulink-menu,
#watch-video-count .watch-expander-head  {
    background: #444 !important;
  border: 1px solid #222 !important;
}

/* Buttons
--------------------*/
.yt-uix-button, .yt-uix-button:active, div.yt-uix-button-menu > table, yt-uix-button-menu-item{
  background-image: url("data:image/jpeg;base64,") !important;
  border: 1px solid #333 !important;
  color: #000 !important;
}

#watch-channel-discoverbox .yt-uix-button yt-uix-carousel-prev, #watch-channel-discoverbox .yt-uix-button yt-uix-carousel-next{
  background: url("data:image/jpeg;base64,") !important;
}

.yt-uix-button-text, .yt-uix-button{
  background: -moz-linear-gradient(center top , #999999, #555555) repeat scroll 0 0 #F6F6F6 !important;
  border:1px solid #222222 !important;
  -moz-border-radius:3px 3px 3px 3px !important;
}

.yt-uix-button-menu-item{
  background-color: #222 !important; 
}

.yt-button, a.yt-button{
  color: #000 !important;
}

/*------------------------------ Shows Page Page ------------------------------------*/
.shmoovies-list-container #recent-column h4 {
  background: #222 !important;
  border-bottom: 1px solid #444 !important;
  color: #888 !important;
}
#recent-tv-list{background: #333 !important;}

/*------------------------------ Search Page ------------------------------------*/

#results-main-content .show-result-types .result-type {
  color: #00A800 !important;
}

#search-duplicates-message{
  background: #333 !important;
  color: #ddd !important;
}

.searchFooterBox div {
  background: none !important;
}

#default-language-box, #html-optional-lang-link{
  background: #333 !important;
  border: 1px solid #222 !important;
}

.pyv-promoted-videos{
 background: #444 !important;
}

#search-section-header{
  border-color: #444 !important;
} 

#search-advanced-form .search-setting-inner {
  background: #333 !important;
  border: 1px solid #222 !important;
}

/* Hovercard On Search Results
-----------------------------------*/
.yt-uix-hovercard-card-border{
  background:#333 !important;
  border:1px solid #000 !important;
}

.yt-uix-hovercard-card-body-arrow, .yt-uix-hovercard-card-body-arrow  {
  border-left-color: #333 !important;
}

/*----------------------------- Video Page -------------------------------------*/

/* Vevo Pages Fix 
----------------------*/
#watch-branded-actions  {
  background: #333 url("http://img696.imageshack.us/img696/206/vevo20.jpg") no-repeat scroll left top !important;
  margin-bottom: 5px !important; border: 1px solid #000 !important;}
#watch-other-vids{background: none !important;}
#page.watch-branded #watch-main-container{background: none !important;}
#watch-branded-actions img {visibility:hidden; }

/* Video Details Panel
--------------------------*/
#watch-info .yt-uix-expander-collapsed .watch-expander-head, #watch-actions-area, .yt-alert-announce{
  background-color: #222 !important;
  color: #ddd !important;
  border: 1px solid #444 !important;  
}

#watch-info, .yt-alert-info, .yt-alert-status{
  background: #333 !important;
  color: #ddd !important;
}

#watch-info .watch-expander-head, .watch-extra-info {
  background: #222 !important;
  color: #ddd !important;
  border: 1px solid #444 !important;
  -moz-border-radius:0px 0px 5px 5px;
}

#watch-owner-container{
  background: #333 !important;  
  border: 1px solid #444 !important;
}

#watch-info.expanded < tbody{
  background: none !important;  
}

/* Video Views Pannel
--------------------------*/
.watch-stats-title-cell, .watch-stats-title tr[style*="background-color: rgb(238, 238, 238);"]{
  background: #444 !important;
  border: 1px solid #444 !important;
}

/* Related Videos
--------------------------*/
#watch-related .title, #watch-sidebar .title{
  color: #ddd !important;
  font-weight: normal !important;
}

#watch-sidebar .watch-module-body {
  background: #333 !important; 
  padding-top: 5px !important;  
  padding-left: 3px !important;
  border-left: 5px solid #444 !important;
  color: #ddd !important; 
}

.video-thumb {
  background-color: #444 !important;
  border-color: #444 !important;
}

a.video-list-item-link:hover, a.video-list-item-link:active, .watch-ppv-vid, #subscribeMessage, .next-list-current, .watch-pyv-vid {
  background: #444 !important; 
}

#watch-channel-discoverbox{
  background: #333 !important;
  border: 1px solid #444 !important;
}

.video-list-item .video-thumb, .video-list-item .user-thumb-large, .video-list-item .playlist-video-thumbs{
  margin:0px 3px 0px 0px !important;
  border-color: #333 !important;
}

/* Playlist / User Channel
-------------------------------*/
#watch-sidebar .watch-passive-list .watch-module-body{
  border-bottom: none !important;
}

.watch-next-list-actions, #watch-sidebar .watch-active-list .watch-module-head, #watch-next-list-actions, #watch-sidebar .watch-module-expandable .watch-module-head{
  background: #444 !important;
  border: 1px solid #444 !important;
}
#watch-sidebar .watch-active-list.yt-uix-expander-collapsed .watch-module-body, #watch-sidebar .watch-active-list .watch-module-body {
  border: none !important;
  border-left: 3px solid #444 !important;
  border-right: 1px solid #444 !important;
}

.watch-module-body-inner, #watch-sidebar .watch-active-list .video-list-item-link  {
 margin-left:-5px !important;
}

/* Mix List
-------------------------------*/
.watch-disco-list-item{
  border-color: #444 !important;
}

.watch-disco-list-item:hover{
  background-color: #444 !important;
}

.watch-disco-list-item .title{
  margin-left: 5px !important;
}

/* Likes / Dislikes
--------------------------*/
#watch-actions .action-bar-ratings-stats{
  background-color: #444 !important;
  border: 1px solid #222 !important;
}

#watch-actions .action-bar-ratings-stats .likes-bar {
  background:none repeat scroll 0 0 #2CC42C !important;
  border-color:#28A428 !important;
}

#watch-actions .action-bar-ratings-stats .dislikes-bar {
  background:none repeat scroll 0 0 #B73B3B !important;
  border-color:#943131 !important;
}

/* DISCO
-----------------------*/
#content.search-mode #watch-search-list {
  background-color: #333 !important;
}

.watch-module-expandable .watch-module-body {
  border-color: #444 !important;
}

#content.search-mode #watch-sidebar .watch-active-QL{
  border-left: none !important;
}

.watch-module-expandable .watch-module-head, .watch-disco-header, .watch-expander-head, .watch-disco-album-video-row:hover   {
  background-color: #444 !important;
  border-color: #444 !important;
}

/* Comments 
-------------------------*/
#watch-discussion .current .wrapper, .wrapper{
  background: none !important;
}

.comments-section h4 {
  border-bottom: 1px solid #444 !important;
}

.comment-list .comment {
  border-bottom: 1px solid #333 !important;
}

.comment-list .parent{
  border: none !important
}

.child .content{
  border-color: #444 !important;
}

#watch-discussion textarea, .watch-comments-post-count input, .comments-post-count input {
  background: #333 !important;
  color: #ddd !important; 
}

#watch-discussion li.current, .comment-list .author-viewing {
  background-color: rgba(256, 256, 256, 0.05) !important;
  border: none !important;
  border-left: 4px solid #444 !important;
  border-bottom: 1px solid #333 !important;
}

.comment-reactiontaglink{
  border-color: #444 !important;
  background: #444 !important;
}

/*------------------------------- User Pages -------------------------------------------*/

/* Subscription Page 
-------------------------------*/
#videos, .video-stat span, #mymedia #list-pane .folder.selected, .actions{
  background: none !important;
  background-color: #282828 !important;
  color: #bbb !important;
  border: none !important;
 }

.settings, #mymedia #view-pane .settings,  #mymedia #view-pane .splitter, .footer, 
#mymedia #list-pane .subfolder.selected, #mymedia #table #heading-filter, #mymedia #table #heading-check {
  background: none !important; 
  background-color: #444 !important;
  color: #bbb !important;
  border: none !important;
  }

/* My Videos
-------------------------------*/
#mymedia #table .video.even, #mymedia #table .video-details.even,  #compose-cell{
  background-color: #333 !important;
}
#mymedia #table .video.odd, #mymedia #table .video-details.odd{
  background-color: #444 !important;
}

#mymedia .yt-uix-expander-body{
  background-color: #333 !important;
}
#mymedia .page-tabs a{
  background-color: #333!important;
  border: none !important;
}  
#mymedia .page-tabs .current a{
  background-color: #444 !important;
  border: none !important;
} 
#mymedia .page-tabs{
  background-color: #222 !important;
}
.videos-edit .nav-header{
 border-bottom: 1px solid #333 !important;
} 
  
/* Upload Videos
-------------------------------*/
.upload-outer-box, #instructions{
  background-color: #333 !important;
  border: 1px solid #222 !important;
}
.upload-inner-box{
  background-color: #444 !important;
  border: none !important;
}

#hd-uploading-box, #about-uploading-box, #sponsored-videos-box, #instructions{
  color: #ddd !important;
}

/* Sign Up Form  
----------------------*/
.signup-table, .google-checkout{
  background: #282828 !important;
}

/* ad Preferences 
----------------------*/
#yt-static-info-box{
  background-color: #333 !important;
  border: 1px solid #222 !important;
  color: #888 !important;
} 

/* Image Replacements 
----------------------*/
img.master-sprite, .master-sprite img {
  background-image: url("data:image/png;base64,") !important;
}

/* Chrome Fixes
------------------- */
.yt-uix-carousel-slides-shade-left, .yt-uix-carousel-slides-shade-right{
  background: none !important;
}}
